// ADD

fn f32_add(bench: &mut Bencher) {
    const MIN: f32 = 1e-45;
    bench.iter(|| {
        for _ in 0..2 {
            F32_DATA.iter().for_each(|x| { black_box(x + MIN); } )
        }
    })
}

fn f64_add(bench: &mut Bencher) {
    const MIN: f64 = 5e-324;
    bench.iter(|| {
        for _ in 0..2 {
            F64_DATA.iter().for_each(|x| { black_box(x + MIN); } )
        }
    })
}

fn float_add(bench: &mut Bencher) {
    const MIN: FloatType = FloatType {frac: 1, exp: -1074};
    bench.iter(|| {
        FLOAT_DATA.iter().for_each(|x| { black_box(x.add(&MIN)); } )
    })
}

fn float_add_less_equal(bench: &mut Bencher) {
    const MIN: FloatType = FloatType {frac: 1, exp: -1074};
    bench.iter(|| {
        FLOAT_DATA.iter().for_each(|x| unsafe { black_box(x.add_less_equal(&MIN)); } )
    })
}

// SUBTRACT

fn f32_subtract(bench: &mut Bencher) {
    const MIN: f32 = 1e-45;
    bench.iter(|| {
        for _ in 0..2 {
            F32_DATA.iter().for_each(|x| { black_box(x - MIN); } )
        }
    })
}

fn f64_subtract(bench: &mut Bencher) {
    const MIN: f64 = 5e-324;
    bench.iter(|| {
        for _ in 0..2 {
            F64_DATA.iter().for_each(|x| { black_box(x - MIN); } )
        }
    })
}

fn float_subtract(bench: &mut Bencher) {
    const MIN: FloatType = FloatType {frac: 1, exp: -1074};
    bench.iter(|| { FLOAT_DATA.iter().for_each(|x| unsafe { black_box(x.sub_unchecked(&MIN)); } ) } )
}

// MULTIPLY

/// Generate native multiply comparisons.
macro_rules! native_multiply_impl {
    ($func:ident, $data:ident, $factor:expr) => (
        fn $func(bench: &mut Bencher) {
            bench.iter(|| {
                for _ in 0..2 {
                    $data.iter().for_each(|x| { black_box(x * $factor); } )
                }
            })
        }
    )
}

/// Generate float type multiply comparisons.
macro_rules! floattype_multiply_impl {
    ($func1:ident, $func2:ident, $meth1:ident, $meth2:ident) => (
        fn $func1(bench: &mut Bencher) {
            bench.iter(|| {
                FLOAT_DATA.iter().for_each(|x| { black_box(x.$meth1()); } )
            })
        }

        fn $func2(bench: &mut Bencher) {
            bench.iter(|| {
                FLOAT_DATA.iter().for_each(|x| unsafe { black_box(x.$meth2()); } )
            })
        }
    )
}

